DROP TABLE IF EXISTS `yjw_trans`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `yjw_trans` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deal_id` int(11) NOT NULL,
  `from_id` int(11) NOT NULL,
  `to_id` int(11) NOT NULL,
  `times` int(11) NOT NULL DEFAULT '0',
  `timestamps` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `confirmed` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `trans_deal_idx` (`deal_id`),
  KEY `trans_from_idx` (`from_id`),
  KEY `trans_to_idx` (`to_id`),
  CONSTRAINT `trans_deal` FOREIGN KEY (`deal_id`) REFERENCES `yjw_deal` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `trans_from` FOREIGN KEY (`from_id`) REFERENCES `yjw_user` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `trans_to` FOREIGN KEY (`to_id`) REFERENCES `yjw_user` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=159 DEFAULT CHARSET=utf8;
